require 'faker'
include Faker

# using faker gem to create unique names to create users
n = 0;


User.destroy_all

30.times do |n|
  name  = Faker::Name.name
  email = "example-#{n+1}@gmail.com"
  password = "123456"
  User.create!(name:  name,
               email: email,
               password:              password,
               password_confirmation: password)
end


Favorite.destroy_all

300.times do
  user = User.all[rand(0...30)]
  product = Product.all[rand(0...400)]
  if user.products.include?(product)
    next
  else
    user.products << product
  end
end

Review.destroy_all

30.times do |n|
  10.times do |m|
    rate = rand(1..5)
    review = Review.create!(product_rating: rate, comment: "aaa#{n}", product_id: n+m+10, user_id: n+1)
    user = User.find(n+1)
    product = Product.find(n+m+10)
    if rate >= 3
      user.like(product)
    else
      user.dislike(product)
    end
  end
end

User.create!(name: "duong", email: "duong@gmail.com", password: "123456", password_confirmation: "123456", role: 1)
